import React from 'react';
import logo from './logo.svg';
import './App.css';



const App = () => {
  return (
    <div className='app-wrapper'>
     <header className='header'>
       <img src ='https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Hanna.svg/1200px-Hanna.svg.png'/>
      </header>
      <nav className='nav'>
        <div className='content'>
          Profile
        </div>
        <div>Messages</div>
      </nav>
      <div>
        Main content
      </div>

    </div>
  );
}

export default App;
